insert into edutrack.courses (id, created_date, description, is_open, name)
values  (0x0B270076E1CB4811B6E3611AB290C2BC, '2025-07-14 17:54:14.630000', 'A gentle introduction to machine learning concepts including supervised learning, regression, and classification.', true, 'Machine Learning Basics'),
        (0x0E46EAA2B8B4450C9F69DB55D6C43C47, '2025-07-14 17:51:28.261000', 'Explore common data structures and algorithms with a focus on problem solving and coding interviews.', true, 'Data Structures and Algorithms'),
        (0x2038B4DCE5F44C18B009796455C4A29E, '2025-07-14 17:55:05.752000', 'Understand the basics of securing systems and data, covering topics like encryption, firewalls, and ethical hacking.', true, 'Cybersecurity Essentials'),
        (0xA7EF403855554375B2DB48D3224D3C36, '2025-07-14 17:53:24.903000', 'Covers relational database concepts, normalization, SQL queries, and JDBC integration with Java.', true, 'Database Systems'),
        (0xB6B242783CC84E2D94FEF0FF242A42FC, '2025-07-14 17:52:50.146000', 'An introductory course to AWS services including EC2, S3, Lambda, and IAM roles.', true, 'Cloud Computing with AWS'),
        (0xBA698554F3E2416282B95DC61C58F38B, '2025-07-14 17:49:52.153000', 'A hands-on course teaching modern frontend development using React, JSX, hooks, and component-based architecture.', true, 'Web Development with React'),
        (0xD6A06BF8181E4288A49C37E7D09465B6, '2025-07-20 17:16:37.207000', 'A comprehensive introduction to Linux, this course covers core concepts of the Linux operating system, command-line navigation, essential utilities, user management, basic networking, file permissions, and scripting skills.', true, 'Linux Fundamentals'),
        (0xD6E0FCCA52424DC086F8AC2067183BA1, '2025-07-14 17:52:16.413000', 'Learn CI/CD, containerization with Docker, orchestration with Kubernetes, and infrastructure as code.', true, 'DevOps Fundamentals'),
        (0xF8E8F77C30D0472C8DD69B8B68BC8C29, '2025-07-14 17:48:57.855000', 'This course covers the basics of Java programming including syntax, OOP principles, and standard libraries.', true, 'Introduction to Java');

